The Channel ID passed is the following:

```
[Fri Oct 21 2022 14:45:23 GMT+0000 (Coordinated Universal Time)] INFO debug: G9Z5GB5AL
```

...yet the functionality implemented is the following:

```javascript
SlackDataStore.prototype.getChannelGroupOrDMById = function getChannelGroupOrDMById(objId) {
   var ret;
   var firstChar = objId.substring(0, 1);

   if (firstChar === 'C') {
     ret = this.getChannelById(objId);
   } else if (firstChar === 'G') {
     ret = this.getGroupById(objId);
   } else if (firstChar === 'D') {
     ret = this.getDMById(objId);
   }
```

This should be a code beginning with `C`.
